import './App.css';
impo
function App() {
  return (
    <div >
      <Router>
      <Navbar /> 
      {/* <LoginSignup /> */}


        <Routes>
          <Route path="/Homepage" element={<Homepage />} />
          <Route path="/aboutpage" element={<AboutPage />} />
          <Route path="/contactpage" element={<ContactPage />} />
          <Route path="/LoginSignup" element={<LoginSignup />} />
          <Route path="/Address" element={<Address />} />

        </Routes>
      </Router> 
    </div>
  );
}

export default App;
